'''Black nails''' are [[nail]]s which, unlike other nails, '''cannot''' be made by players. Black nails can be obtained from thieving [[Ogre coffins]] or as a drop from [[Zombie (Tarn's Lair)|zombies]] in [[Tarn's Lair]]. They may also be obtained while clearing rubble during the [[In Aid of the Myreque]] quest.

Black nails can be used to [[construct]] certain types of wooden [[furniture]]. With 38 [[Fletching]], they can be used on [[flighted ogre arrow]]s to create [[black brutal]] arrows, granting 6.5 Fletching experience per arrow.
